import WelcomeVideo from "../../assets/WelcomeVideo.mp4";
import classes from "./Home.module.css"

function Home(){
return (
    <div className={classes.home}>
       <video className={classes.home} autoplay>
        <source src={WelcomeVideo} type="video/mp4" width="100%"/>
       </video>
    </div>
)
}

export default Home;
